import './App.css';
import DashBoard from './Component/DashBoard';
import {
  BrowserRouter,
  Routes,
  Route,
} from "react-router-dom";
function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Routes>
        <Route path="/" element={<DashBoard/>}></Route>
      </Routes>
      </BrowserRouter>

    </div>
  );
}

export default App;
